import React, { useState } from 'react';

const Login = () => {

 const [username, setUsername] = useState('');
 const [password, setPassword] = useState('');

 // Rest of the component logic

 const handleNameChange = (e) => {

 setUsername(e.target.value);

 };

 const handlePasswordChange = (e) => {

setPassword(e.target.value);

 };

 const handleSubmit = (e) => {
 e.preventDefault();

 // Perform login authentication logic here
 // You can use APIs or other authentication mechanisms

 console.log('Name:', username);
console.log('Password:', password);

 // Reset form fields

 setUsername('');
 setPassword('');
 };
 return (

 <div>
    <center>
 <h2>Login</h2>
 </center>
 <form onSubmit={handleSubmit}>
 <div>
 <center>
 <label>Username:</label>
 <input type="username my-2" value={username} onChange={handleNameChange} required />
 </center>
 </div>
 <div>
 <center>
 <label>Password:</label>
 <input type="password" value={password} onChange={handlePasswordChange} required />
 </center>
 </div>
 <div className="ms-3">
 <center>
 <button type="submit" className="btn btn-primary my-2">Login</button>
 </center>
 </div>
 <div className="ms-3">

<center>

<button type="button" class="btn btn-primary mx-5">Signup</button>

 <button className="btn btn-primary btn-block" style={{ width: "160px" }}><span>Change</span>

 <span style={{ marginLeft: "5px" }}>Password</span></button>

 </center>

 </div>
 </form>
 </div>
 );

};




export default Login;
